INSERT INTO `noticias` (`ID`, `Titulo`, `Resumen`, `Foto`, `Noticia`) VALUES
(4, 'Así va el coronavirus en RD, en datos de Salud Pública', 'El ministro de Salud Pública, Rafael Sánchez Cárdenas, ofrece nuevos detalles sobre el avance del coronavirus COVID-19 en el país en una rueda de prensa virtual este Martes Santo desde la sede de la institución que dirige.', 'data:image/jpeg;base64,', 'El ministro de Salud Pública, Rafael Sánchez Cárdenas, ofrece nuevos detalles sobre el avance del coronavirus COVID-19 en el país en una rueda de prensa virtual este Martes Santo desde la sede de la institución que dirige.\r\n\r\nHasta la rueda de prensa de ayer en el país había 1,828 casos confirmados de la enfermedad. También había 86 muertes y 33 personas recuperadas.\r\n\r\nEn el país se descartaron 3,661 casos. Hay 1,481 personas en aislamiento domiciliario y 228 en aislamiento hospitalario.\r\n\r\nRepública Dominicana ocupaba hasta ayer el noveno lugar de los países de América Latina en el número de pruebas de coronavirus que se han realizado por cada millón de habitantes con un total de 419 test, según “Worldometer”, un portal que cuenta con cifras en vivo de la propagación del virus por el mundo.');
INSERT INTO `noticias` (`ID`, `Titulo`, `Resumen`, `Foto`, `Noticia`) VALUES
(5, 'Un total de 39,547 empresas han solicitado la suspensión de 686,547 trabajadores', 'Unas 39,547 empresas han solicitado hasta este lunes la suspensión de 686,547 trabajadores, ante el Ministerio de Trabajo.', 'data:image/jpeg;base64,', 'Estas suspensiones se han pedido a través de 63,502 solicitudes, que las 39,547 empresas han depositado por sus diferentes establecimientos.\r\n\r\nAsí lo informó el ministro de Trabajo, Winston Santos, quien explicó que de 686 mil empleados suspendidos, 604,913 aplican para ser beneficiados con el programa Fondo de Asistencia Solidaria al Empleado (FASE) 1.\r\n\r\nEntrevistado en el programa radial la Opción de la Mañana, que se transmite por Independencia 93.3, el ministro explicó que no aplican para FASE 1, los empleados de empresas de farmacias, supermercados, colmados, y de distribución y transporte de materias primas, de alimentos y de seguridad, minas ni del sector financiero, porque a estas no se les ha permitido operar.\r\n\r\nIndicó además que el Gobierno pagará el 70% del salario de los trabajadores suspendidos durante dos meses, siempre y cuando aplique para el mínimo de 5 mil, y el máximo de 8,500 pesos.\r\n\r\n“No está obligada, lo que ocurre es realmente que la suspensión es sin pago de salario, el Gobierno lo que hace es que insta, ósea le pide a los trabajadores que cubran esa parte”, indicó al ser cuestionado sobre el otro 30% del salario, el cual el Gobierno a recomendado a los empleadores a cubrir.\r\n\r\nEstas medidas solo aplican para los sectores formales de la economía, y los informales, deberán acogerse a la protección estatal a través de otros programas como el Quédate en Casa y Progresado con Solidaridad, ayudas que se entregarás de acuerdo a la identificación y registro del Sistema Único de Beneficiarios (SIUBEN).\r\n\r\n“El programa fase , tenemos ahora registrados 616 mil, en fase, trabajadores formales, pero eso no se detiene, continúan los registros, ahora una cosa es FASE, y otra cosa es Quédate en Casa”, puntualizó el ministro.\r\n\r\nRecordó a los empleadores que deben poner el número de cuenta y el banco de sus empelados suspendidos para que puedan ser beneficiados con el pago temporal, puesto que de los 604 registrados para Fase, solo se pudieron enviar a hacienda 371 mil en el día de ayer, y reiteró que todos estos trámites se pueden hacer por la vía digital a través de la pagina web del ministerio.\r\n\r\nEl Fondo de Asistencia Solidaria al Empleado busca apoyar a los trabajadores, de manera transitoria, con una transferencia monetaria no condicionada, que forma parte de las medidas anunciada por el presidente Danilo Medina en su discurso sobre la crisis generada por el coronavirus.'),
(6, 'Pandemia de coronavirus deja más de 75.000 muertos en el mundo', 'El nuevo coronavirus ha provocado al menos 75.542 muertos en el mundo desde que apareció en diciembre de 2019, según un balance establecido a las 11H00 GMT del martes 7 de abril por la AFP en base a fuentes oficiales.', 'data:image/jpeg;base64,', 'Desde el comienzo de la epidemia se contabilizaron más de 1.351.000 casos de contagio en 191 países o territorios.\r\n\r\nLa cifra de diagnosticados positivos refleja sin embargo sólo una parte de la totalidad de contagios debido a las políticas dispares de los diferentes países para diagnosticar los casos, algunos sólo lo hacen con aquellas personas que necesitan una hospitalización.\r\n\r\nLas autoridades consideran que hasta ahora, al menos 253.900 personas se curaron de la enfermedad.\r\n\r\nLa cantidad de muertos en Italia, que registró su primer deceso vinculado al virus a fines de febrero, asciende a 16.523. El país registró 132.547 contagios. Las autoridades italianas consideran que 22.837 personas sanaron.\r\n\r\nDespués de Italia, los países más afectados son España con 13.798 muertos y 140.510 casos, Estados Unidos con 10.993 muertos (368.449 casos), Francia con 8.911 muertos (98.010 casos) y Reino Unido con 5.373 muertos (51.608 casos).\r\n\r\n\r\n \r\nChina continental (sin contar Hong Kong y Macao), donde la epidemia estalló a finales de diciembre, tiene un total de 81.740 personas contagiadas, de las que 3.331 murieron y 77.167 sanaron totalmente. En las últimas 24 horas se han registrado 32 nuevos casos y 0 fallecimientos.\r\n\r\nEn cantidad de casos, Estados Unidos es el país más afectado con 368.449 contaminaciones oficialmente diagnosticadas, entre ellas 10.993 muertes y 19.865 sanados.\r\n\r\nDesde lunes a las 19h00 GMT, Malawi, Madagascar y Benín anunciaron las primeras muertes vinculadas al nuevo coronavirus.\r\n\r\nEl martes a las 11H00 GMT y desde el comienzo de la epidemia, Europa sumaba 53.928 fallecidos (708.951 contagios), Estados Unidos y Canadá 11332 (384.947), Asia 4.308 (122.348), Medio Oriente 4083 (81.952), América latina y el Caribe 1353 (35.842), África 493 (10.005) y Oceanía 45 (6.962).\r\n\r\nEste balance fue realizado utilizando datos de las autoridades nacionales recopilados por las oficinas de AFP y con informaciones de la Organización Mundial de la Salud (OMS).');
INSERT INTO `noticias` (`ID`, `Titulo`, `Resumen`, `Foto`, `Noticia`) VALUES
(7, 'República Dominicana ocupa el noveno lugar de América Latina en total de pruebas de COVID-19 por cada millón de habitantes', 'Al día seis de abril, República Dominicana ocupaba el noveno lugar de los países de América Latina en el número de pruebas de coronavirus que se han realizado por cada millón de habitantes con un total de 419 test, según “Worldometer”, un portal que cuenta con cifras en vivo de la propagación del virus por el mundo.', 'data:image/jpeg;base64,', 'De 16 países de América Latina contabilizados en estas estadísticas consultadas por Listín Diario, República Dominicana, pese a que en 2019 tuvo el mayor crecimiento económico de la región, en cuanto a los test de COVID-19 por cada millón de habitantes se encuentra por debajo.\r\n\r\nLos primeros cinco países que más pruebas por COVID-19 han realizado por cada millón de habitantes son Chile con 2,870 pruebas; Panamá con 2,259; Uruguay con 1,499; Costa Rica con 1,001 y Ecuador con 739.\r\n\r\nEl sexto, séptimo y octavo lugar del ranking de América Latina en las pruebas realizadas por cada millón de habitantes lo ocupan Perú (589 pruebas), Colombia (497 pruebas) y Cuba (462), respectivamente.\r\n\r\nAl comparar la media del continente americano en este renglón, la cual se ubica en 1,189 pruebas del coronavirus por cada millón de habitantes, República Dominicana hace el 64.7% menos de estos análisis.\r\n\r\nLos últimos lugares\r\n\r\nA la posición de República Dominicana, le siguen Paraguay (263 pruebas), Brasil (258 pruebas), Argentina (237), México (140), Guatemala (63), Venezuela (63), Bolivia (51) y Haití (22).');

